import { currentUserId } from './apiModels';
import { ChatMessageGet } from './models';
import { Avatar } from '@mui/material';
import makeStyles from '@mui/styles/makeStyles/makeStyles';

type MessageProps = {
  chatMessage: ChatMessageGet;
};

export const Message = ({ chatMessage }: MessageProps) => {
  const classes = useStyles();

  return (
    <li
      className={`message ${chatMessage.sender.id === currentUserId && 'self'}`}
    >
      {chatMessage.sender.id !== currentUserId && (
        <Avatar alt={chatMessage.sender.firstname} />
      )}
      <div
        className={
          chatMessage.sender.id === currentUserId
            ? classes.messageDataSender
            : classes.messageDataRecipient
        }
      >
        {chatMessage.content}
      </div>
    </li>
  );
};

const useStyles = makeStyles({
  messageDataSender: {
    padding: '14px',
    borderRadius: '24px',
    backgroundColor: '#93E1D8'
  },
  messageDataRecipient: {
    padding: '14px',
    borderRadius: '24px',
    backgroundColor: '#DDFFF7'
  }
});
